import React from "react";
import "./index.css";

const App = () => {
  return (
    <div className="app-container">
      <div className="flex-container">
        <img
          src="./logoseaherbs.png"
          alt="Logo Sea Herbs"
          className="logo"
          style={{ width: "100px", height: "auto" }}
        />
        <div className="container">
          <input
            type="text"
            placeholder="Search..."
            className="input"
            style={{
              background: "transparent",
              border: "none",
              outline: "none",
              width: "200px", // Set an initial width here
              fontWeight: "500",
              fontSize: "16px",
              transition: "0.8s",
              bo
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default App;
